import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
  useParams,
} from "react-router-dom";

const TopicPage = () => {
  const { topic } = useParams();
  return <h3>Topic: {topic}</h3>;
};

export default TopicPage;
